import React from "react";
import styled from "styled-components";

const FooterContainer = styled.footer`
  background-color: #B4864D;
  padding: 10px 20px;
  text-align: center;
  width: 100%;
  color: white;
  display: flex;
  justify-content: space-between;
  align-items: center;
  position: fixed;
  bottom: 0;
  left: 0;
  right: 0;
  z-index: 1000;
`;

const FooterLinks = styled.div`
  display: flex;
  gap: 20px;
`;

const FooterLink = styled.a`
  color: white;
  text-decoration: none;
  font-weight: bold;
  &:hover {
    text-decoration: underline;
  }
`;

const FooterLeft = styled.div`
  display: flex;
  gap: 20px;
`;

const FooterText = styled.p`
  margin: 0;
  font-size: 14px;
`;

const Footer = () => {
  return (
    <FooterContainer>
      <FooterLeft>
        <FooterText>Soporte</FooterText>
        <FooterText>FAQ</FooterText>
      </FooterLeft>
      <FooterLinks>
        <FooterLink href="#">Términos</FooterLink>
        <FooterLink href="#">Privacidad</FooterLink>
        <FooterLink href="#">Cookies</FooterLink>
      </FooterLinks>
      <FooterText>© 2024 Todos los Derechos Reservados</FooterText>
    </FooterContainer>
  );
};

export default Footer;
